import React, { useEffect, useState } from 'react'

export function Test() {
    const [data, setData] = useState({})
    useEffect(() => {
        const url = `http://voicebank.com:8001/api/method/voicebank.voicebank_api.voice_data?language=tamil&gender=&slang=&age=`;
        axios.get(url)
            .then((response)=>(
                setData(response.data)
            ))
    },[])
    return (
        <>
        <div>test</div>
        <h1>{data.first_name}</h1>
        {data ? <h1>{data.first_name}</h1> : <p>Loading...</p>}
        </>
    )
}
